import React from "react";
import Dropdown from 'react-bootstrap/Dropdown';
import {Nav, Navbar, NavDropdown} from "react-bootstrap";

export class Navegador extends React.Component {

    render() {
        return(
            <div>
                <Navbar>
                    <Nav className="mr-auto">
                        <Nav.Link href="#home">Home</Nav.Link>
                        <Nav.Link href="#link">Link</Nav.Link>
                        <NavDropdown title={this.props.name} id="basic-nav-dropdown">
                            <NavDropdown.Item onClick={this.props.onClick}>Tanca sessió</NavDropdown.Item>
                            <NavDropdown.Item href="#action/3.2">Another action</NavDropdown.Item>
                            <NavDropdown.Item href="#action/3.3">Something</NavDropdown.Item>
                            <NavDropdown.Divider />
                            <NavDropdown.Item href="#action/3.4">Separated link</NavDropdown.Item>
                        </NavDropdown>
                    </Nav>
                </Navbar>
                <Dropdown>
                    <Dropdown.Toggle variant="dark" id="dropdown-basic">
                        {this.props.name}
                    </Dropdown.Toggle>

                    <Dropdown.Menu>
                        <Dropdown.Item >Tanca sessió</Dropdown.Item>
                    </Dropdown.Menu>
                </Dropdown>
            </div>


        );
    }
}
